function App() {
  return (
    <Router>
      <nav className="navbar navbar-dark bg-dark">
        <div className="container flex-start">
          <Link to="/" className="navbar-brand">Cat√°logo</Link>
          <Link to="/dados" className="navbar-brand">Novo</Link>
